import React, { Component } from 'react';
import { render } from 'react-dom';

import { Pannellum } from "pannellum-react";
import myImage from "./images/alma.jpg";

function sayHello() {
  console.log("clicked");
}


const PannellumReact = (props) => (
  <div>
    <button onClick={sayHello}>Button 0</button>;
    <Pannellum
        width="100%"
        height="1000px"
        image={myImage}
        pitch={10}
        yaw={180}
        hfov={110}
        autoLoad
        onLoad={() => {
            console.log("panorama loaded");
        }}
    >
    <button onClick={sayHello}>Button 1</button>;
    </Pannellum>
    <button onClick={sayHello}>Button 2</button>;
  </div>
);

export default PannellumReact;
